export const UserLanding = () => {
    return (
        <>
            <Header />
            <SubHead>
                <button>Height</button>
                <button>Weight</button>
                <button>PT Score</button>
            </SubHead>
            <Container>
                <LineGraph />
            </Container>
        </>
    )
}
